import React from "react";

const Tour = ({ id, name, info, image, price }) => {
  return (
    <div className="single_tour">
      <img src={image} alt={name} />
      <div className="tour_info">

        <p>{info}</p>
      </div>
    </div>
  );
};

export default Tour;
